      operationId: get-service-history
      description: |-
        This API is to get the service history of one or more service types. These entries can be queried for a certain period (start date and end date), and can be paginated. This is an authenticated API. This will return all the different categories of requests.

        The five service types are:
        AUTHENTICATION_REQUEST
        SERVICE_REQUEST
        DATA_UPDATE_REQUEST
        ID_MANAGEMENT_REQUEST
        DATA_SHARE_REQUEST
      parameters:
        - schema:
            type: string
          in: query
          name: serviceType
          description: 'The service type in general. It can map to different request types. Possible values: AUTHENTICATION_REQUEST, SERVICE_REQUEST,DATA_UPDATE_REQUEST,ID_MANAGEMENT_REQUEST,DATA_SHARE_REQUEST,ALL; default is ALL'
        - schema:
            type: string
          in: query
          name: fromDate
          description: Start date of the request inclusive; the default date will be the 1st of January of that year
        - schema:
            type: string
          in: query
          name: toDate
          description: End date of the request inclusive; the default date will be the date on which this transaction is being done (todayâ€™s date)
        - schema:
            type: string
            maxLength: 30
            minLength: 0
          in: query
          name: searchText
          description: This will be used to look for Event Id- string greater than 0 but not more than 30
        - schema:
            type: string
          in: query
          name: sortType
          description: 'ASC/DESC, default is ASC'
        - schema:
            type: string
          in: query
          name: pageStart
          description: 'integer starting from 0, default is 0'
        - schema:
            type: string
          in: query
          name: pageFetch
          description: 'integer greater than 0, default is 10'
        - schema:
            type: string
          in: cookie
          name: Authorization
          required: true
          description: Authorization token is used to validate the permissions carried by the user.
        - schema:
            type: string
          in: cookie
          name: id_token
          description: Id token is used to verify which user has logged in.
          required: true
        - schema:
            type: string
          in: query
          name: statusFilter
          description: 'Comma separated service types status code- optional. This can be one of - ALL,SUCCESS,IN_PROGRESS,FAILED'
        - schema:
            type: string
          in: header
          description: Locale based on Language and country. Used in date time formatting. Ex. en-US
          name: locale
        - schema:
            type: string
          in: header
          name: time-zone-offset
          description: Used in time conversion per the client on any timestamps returned in the response. Ex. -330 - for India
